@RyanMarkustin @AviationGin R.I.P. Vodka (1405-2021)

Vodka had a long and tough life. Born with zero flavor, it still made a name for itself. It was the 84th best thing to come from a potato and spawned countless regrets and Russian stereotypes.

In lieu of flowers, survivors ask you to buy @AviationGin.

